import math

def prime_factors_count(n):
    count = 0
    while n % 2 == 0:
        count += 1
        n = n // 2
    for i in range(3, int(math.sqrt(n)) + 1, 2):
        while n % i == 0:
            count += 1
            n = n // i
    if n > 2:
        count += 1
    return count

def gcd(a, b):
    if a == 0 or b == 0:
        return max(a, b)
    if a > b:
        a %= b
    else:
        b %= a
    return gcd(a, b)

def can_make_equal_in_k_turns(a, b, k):
    if a > b:
        (a, b) = (b, a)
    godNM = gcd(a, b)
    gcdNM = 0
    gcdNM -= prime_factors_count(a // godNM)
    gcdNM += prime_factors_count(b // godNM)
    gcdNM += prime_factors_count(godNM)
    if 1 <= k <= gcdNM and a != b and (a % b == 0):
        return 'Yes'
    elif 2 <= k <= gcdNM:
        return 'Yes'
    else:
        return 'No'

